import { createRouter, createWebHistory } from 'vue-router'
import MainSilde from '../views/main/MainSilde.vue'
import TableTopMenu from '@/views/menu/TableTopMenu.vue'
import BoxList from '@/views/box/BoxList.vue'
import Phone from '@/views/barcode/Barcode.vue'
import HandWriter from '@/views/handwriter/HandWriter.vue'
import ReceiptList from '@/views/receipt/ReceiptList.vue'
import ReceiptSelected from '@/views/receipt/ReceiptSelected.vue'
import ConfirmMeasurement from '@/views/receipt/ConfirmMeasurement.vue'
import IngMeasurement from '@/views/receipt/IngMeasurement.vue'
import ConfirmReceipt from '@/views/receipt/ConfirmReceipt.vue'
import ConfirmPayment from '@/views/payment/ConfirmPayment.vue'
import AddTag from '@/views/payment/AddTag.vue'
import PushTag from '@/views/payment/PushTag.vue'
import ReceiptNo from '@/views/receiptno/ReceiptNo.vue'
import Banner from '@/views/main/Banner.vue'


const routes = [
  {
    path: '/',
    name: '/',
    component:MainSilde
  },
  {
    path : '/tabletopmenu',
    name : '/tabletopmenu',
    component : TableTopMenu
  },
  {
    path : '/boxlist',
    name : '/boxlist',
    component : BoxList
  },
  {
    path : '/barcode',
    name : '/barcode',
    component : Barcode
  },
  {
    path : '/handwriter',
    name : '/handwriter',
    component : HandWriter
  },
  {
    path : '/receiptlist',
    name : '/receiptlist',
    component : ReceiptList
  },
  {
    path : '/receiptselected',
    name : '/receiptselected',
    component : ReceiptSelected
  },
  {
    path : '/confirmmeasurement',
    name : '/confirmmeasurement',
    component : ConfirmMeasurement
  },
  {
    path : '/ingmeasurement',
    name : '/ingmeasurement',
    component : IngMeasurement
  },
  {
    path : '/confirmreceipt',
    name : '/confirmreceipt',
    component : ConfirmReceipt
  },
  {
    path : '/confirmpayment',
    name : '/confirmpayment',
    component : ConfirmPayment
  },
  {
    path : '/addtag',
    name : '/addtag',
    component : AddTag
  },
  {
    path : '/pushtag',
    name : '/pushtag',
    component : PushTag
  },
  {
    path : '/receiptno',
    name : '/receiptno',
    component : ReceiptNo
  },
  {
    path : '/banner',
    name : '/banner',
    component : Banner
  }

]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
